import {useState} from 'react';

function App() {

  const [data, setData] = useState([
    {
      name: 'list 1'  
    },{
      name: 'list 2'
    },{
      name: 'list 3'
    },{
      name: 'list 4'
    } 
  ]);


  return (
    <>
      <center><h1>Todo List</h1></center>
      <div style={{'display': 'flex'}}>
        <div style={{'display': 'inline'}} >
          <input type='text' />
          <button style={{'marginLeft': '1rem', }} name='Add'>Add</button>
        </div>
        {
          data.map((list, i) => {
            <p>{list}</p>
          })
        }
      </div>
    </>
  );
}

export default App;
